// src/services/AIService.ts
import { exec as exec2 } from "child_process";
import { promisify as promisify2 } from "util";
var execAsync2 = promisify2(exec2);

class AIService {
  apiKey;
  apiUrl = "https://generativelanguage.googleapis.com/v1beta/models/gemini-pro:generateContent";
  constructor(apiKey) {
    this.apiKey = apiKey;
  }
  async getSuggestions(changes) {
    try {
      const prompt2 = await this.constructPrompt(changes);
      const response = await axios_default.post(`${this.apiUrl}?key=${this.apiKey}`, {
        contents: [{
          parts: [{
            text: prompt2
          }]
        }],
        generationConfig: {
          temperature: 0.7,
          topP: 0.8,
          topK: 40,
          maxOutputTokens: 1024
        }
      });
      return this.parseResponse(response.data);
    } catch (error) {
      if (axios_default.isAxiosError(error)) {
        console.error("API Response:", error.response?.data);
        throw new Error(`Failed to generate commit suggestions: ${error.response?.data?.error?.message || error.message}`);
      }
      throw error;
    }
  }
  getFileScope(filename) {
    const ext = filename.split(".").pop()?.toLowerCase();
    switch (ext) {
      case "ts":
      case "tsx":
        return "typescript";
      case "js":
      case "jsx":
        return "javascript";
      case "css":
      case "scss":
        return "styles";
      case "test.ts":
      case "spec.ts":
        return "tests";
      case "md":
        return "docs";
      default:
        return filename.split("/")[0] || "core";
    }
  }
  async getRepoContext() {
    try {
      const { stdout: branch } = await execAsync2("git branch --show-current");
      const { stdout: recentCommits } = await execAsync2("git log -3 --oneline");
      return `Branch: ${branch.trim()}

Recent commits:
${recentCommits}`;
    } catch {
      return "";
    }
  }
  async constructPrompt(changes) {
    const scopes = [...new Set(changes.map((c) => this.getFileScope(c.filename)))];
    const stats = changes.reduce((acc, curr) => ({
      additions: acc.additions + curr.additions,
      deletions: acc.deletions + curr.deletions
    }), { additions: 0, deletions: 0 });
    const repoContext = await this.getRepoContext();
    return `As an expert developer, analyze these git changes and suggest commit messages.

Repository Context:
${repoContext}

Changes Summary:
- Files changed: ${changes.length}
- Total: +${stats.additions} -${stats.deletions}
- Modified components: ${scopes.join(", ")}

Changes:
${changes.map((change) => `
File: ${change.filename}
Type: ${this.getFileScope(change.filename)}
Changes: +${change.additions} -${change.deletions}
Status: ${change.status}
Diff:
${change.diff}
`).join(`
`)}

Generate THREE different commit messages following these rules:
- Use conventional commits format: type(scope): description
- Types: feat|fix|refactor|style|docs|test|chore|perf
- Keep description under 50 characters
- Use imperative mood ("add" not "added")
- Don't capitalize first letter
- No period at end

Return exactly three commit messages in this JSON format:
{
  "suggestions": [
    {
      "message": "type(scope): description",
      "explanation": "Why this message fits the changes"
    },
    {...},
    {...}
  ]
}`;
  }
  parseResponse(response) {
    try {
      const text = response.candidates[0].content.parts[0].text;
      const cleanedResponse = text.replace(/^```(?:json)?\n?|\n?```$/g, "").trim();
      const parsed = JSON.parse(cleanedResponse);
      if (!parsed.suggestions || !Array.isArray(parsed.suggestions)) {
        throw new Error("Invalid response format: missing suggestions array");
      }
      return parsed.suggestions.map((s) => s.message);
    } catch (error) {
      console.error("Error parsing Gemini response:", error);
      throw new Error("Failed to parse commit suggestions");
    }
  }
}

// src/CommitSuggester.ts
import { exec as exec3 } from "child_process";
import { promisify as promisify3 } from "util";
var execAsync3 = promisify3(exec3);

class CommitSuggester {
  gitService;
  aiService;
  constructor(config) {
    this.gitService = new GitService;
    this.aiService = new AIService(config.apiKey);
  }
  async getSuggestions() {
    try {
      if (!await this.gitService.hasGitConfig()) {
        throw new Error(`Git user not configured. Run:
git config --global user.email "you@example.com"
git config --global user.name "Your Name"`);
      }
      const files = await this.gitService.getStagedFiles();
      const suggestions = await this.aiService.getSuggestions(files);
      return suggestions;
    } catch (error) {
      if (error instanceof Error && error.message.includes("No staged changes")) {
        throw new Error("No changes staged for commit. Use git add to stage your changes.");
      }
      throw error;
    }
  }
  async commitChanges(message) {
    try {
      const stagedChanges = await execAsync3('git diff --staged --quiet || echo "has changes"');
      if (!stagedChanges) {
        throw new Error("No changes staged for commit. Use git add to stage your changes.");
      }
      const escapedMessage = message.replace(/"/g, "\\\"");
      await execAsync3(`git commit -m "${escapedMessage}"`);
      console.log("Changes committed successfully!");
    } catch (error) {
      if (error instanceof Error) {
        if (error.message.includes("not a git repository")) {
          throw new Error("Not a git repository. Initialize git first with: git init");
        } else if (error.message.includes("please tell me who you are")) {
          throw new Error(`Git user not configured. Run:
git config --global user.email "you@example.com"
git config --global user.name "Your Name"`);
        }
        throw error;
      }
      throw new Error("Failed to commit changes");
    }
  }
  async getCurrentBranch() {
    return this.gitService.getCurrentBranch();
  }
  async getRecentCommits() {
    return this.gitService.getRecentCommits();
  }
}

// src/cli.ts
var main = async () => {
  try {
    const apiKey = process.env.GEMINI_API_KEY;
    if (!apiKey) {
      throw new Error("GEMINI_API_KEY environment variable is not set");
    }
    const suggester = new CommitSuggester({ apiKey });
    const suggestions = await suggester.getSuggestions();
    const choices = [
      ...suggestions.map((msg, i) => ({ name: msg, value: msg })),
      { name: "Write custom commit message", value: "custom" }
    ];
    const { selectedCommit } = await lib_default.prompt([
      {
        type: "list",
        name: "selectedCommit",
        message: "Select a commit message:",
        choices
      }
    ]);
    if (selectedCommit === "custom") {
      const { customMessage } = await lib_default.prompt([
        {
          type: "input",
          name: "customMessage",
          message: "Enter your commit message:"
        }
      ]);
      if (!customMessage.trim()) {
        console.log("Commit canceled - empty message");
        process.exit(0);
      }
      await suggester.commitChanges(customMessage);
    } else {
      await suggester.commitChanges(selectedCommit);
    }
  } catch (error) {
    console.error("Error:", error.message);
    process.exit(1);
  }
};
main();
